(14160, 6202, 0, 1, '白土司', '最近感冒猖狂、我馬上把感冒介紹給爸媽，他們也馬上趕上流行，嘖嘖！\r\n大家注意身體健康！～', '0000-00-00 00:00:00', 0000, 0, 1, 7, '一個人的房間\r\n我也不想病焉焉\r\n想念外面花草的香味\r\n\r\n想妳長髮披肩\r\n微風徐徐吹我臉\r\n躺在大自然裡看藍天\r\n\r\n躲在電腦前啃白土司一片\r\n突然在土司上有了新的發現\r\n\r\n不知是否是咖啡因在作祟\r\n渴的意念像藤蔓爬滿我周圍\r\n\r\n忽然冒出綠葉\r\n靈魂出竅一些\r\n飄到了咖啡店\r\n點了磨卡一杯\r\n\r\n那綿密的好滋味\r\n像簡訊般的露水\r\n滴答滴在   我心蔓延', '', 248, '', 'Backer', 'Backer', '', '', '', 0, 1, 0, '2009-02-04 20:03:33', '2015-03-12 13:37:42', '0000-00-00 00:00:00'),
