(14165, 9117, 1700, 1, 'Peach&Apple', '文◎STAYCOOL 主唱 洪璽開(洪開)\r\n\r\n從拉薩回到台灣的那天晚上，下飛機的時候天氣很好，任何的吐納都非常自在，不得不讓人讚嘆低海拔的氧氣們，是多嚜大方的讓人們吸吮～嘴巴裡還留著酥油茶的味道。很喜歡西藏的平靜，不過我也愛台北，因為那是我的家。\r\n\r\n車子在國道二號上限速移動，吹著風抽菸，游睿問我.....\r\n"呃.....你在寫peach&apple這歌的時候，想法主軸是什麼？"\r\n\r\n"啊？"（游睿是個要有主軸才能寫歌的人，BIOS工程師總是關心最核心東西）\r\n\r\n"我不知道耶，我的生活大概是一些片斷的文字和瑣碎的感想結合，沒有真正的中心思想，不是愛情不是工作不是朋友，那大概就是生活"我說。\r\n\r\nLife is like a platform to nowhere\r\nHere you come then I go without trace\r\nDare you taste and swallow that apple and sacred no more\r\n\r\n你來我往的生活啊，誰也不知道何時會相遇何時要離開\r\n誰願意留下來分享蘋果。\r\n\r\nPeach是蟠桃園的時蔬\r\nApple是伊甸園的名產\r\n\r\n大家夢想中的烏托邦都有個水果當"主軸"阿\r\n\r\n我不曾到過伊甸園，不過卻在前往拉薩的路上見到了西王母的蟠桃園的舊址，沒有幻夢中的仙境，只有高原稀薄的630吧低氣壓和65%含氧量，和刺骨的大風。\r\n\r\n', '2007-05-19 00:00:00', 0000, 0, 2, 5, '<Peach and Apple>\r\n* 2007年 ICRT Battle of the Band 第三名\r\n\r\nTell me is life really wonderful\r\nTell me you’re everything I’m longing for\r\nI don’t know\r\nI don’t know\r\nI don’t know this at all\r\n\r\nYou told the story ‘bout stairway to paradise\r\nThere’re peach blossom like milky way through the night\r\nNo sorrow underneath\r\nWith purest air to breathe\r\nThis what you know\r\n\r\nBut I didn’t hear what you’ve said\r\nLife is like a platform to nowhere\r\nHere you come then I go without trace\r\nDare you taste and swallow that apple and sacred no more\r\n\r\nIn this life, how could I meet you?\r\nIn this life, how would you want me too?\r\nYou don’t know\r\nYou don’t know\r\nYou don’t know me at all\r\n\r\nYou say I sing about peach and humanity\r\nNow you’re looking for ~oh brand new melody\r\nHow simple life can be\r\nIt ain’t easy to see\r\nThis what I know\r\n\r\nBut you didn’t hear what I’ve said\r\nLife is like a platform to nowhere\r\nHere you come then I go without trace\r\nDare you taste and swallow that apple and sacred no more\r\n', '', 190, '', '洪璽開(洪開)', '洪璽開(洪開)', '陳品先', 'STAYCOOL樂團', '', 1, 1, 0, '2009-02-04 23:58:47', '2015-03-12 13:37:42', '0000-00-00 00:00:00'),
(14166, 9117, 1700, 2, '大雨，大禹', '清晨的雨，下在城市裡\r\n無精打采的早晨，大雨傾盆\r\n如果這是世界的盡頭，那該怎麼拯救\r\n\r\n星期一焦慮症候群之奇幻之旅\r\n\r\n凝視窗外的城市冥想\r\n大禹治水、諾亞方舟\r\n上古時代的煩惱，掉進現代人的頭腦\r\n\r\n', '2007-05-19 00:00:00', 0000, 0, 2, 5, '<大雨，大禹>\r\n\r\n* 簡單生活節：創作音樂徵選！ (入選作品)\r\n\r\n臉色慘白，燈光昏暗，每天，每天，每天。\r\n快不快樂，天空的顏色，不像夢裡那樣清澈。\r\n\r\n這個城市，像一片海，點點雨滴，淋濕我的臉。\r\n雨這麼快，什麼都來不及交待，就這樣，未來一切重來。\r\n\r\n大雨，大雨，嘩啦啦，伊耶，伊耶。\r\n\r\nWho can survive this lonely kind of life?\r\nHow can I tell a lie to leave you alone tonight?\r\nWhen the sky can''t help crying, then who babysit the earth?\r\nHow can I save this world as you did?\r\n\r\n不理不睬，這個陌生年代，只剩，無奈，感慨。\r\n靈魂出走，搭造一座方舟，從此獨自異域漂泊。\r\n\r\n大雨，大雨，嘩啦啦，伊耶，伊耶~~\r\n\r\n地球已經不旋轉，像你的腦袋。\r\n三過你的家門，卻不進來。Tell me why?\r\n\r\n早上七點，拉開門簾。\r\n窗外，已經，放晴。', '', 214, '', '陳品先、洪璽開(洪開)、游睿威(游睿) ', '洪璽開(洪開)、劉玲君(小君) ', '陳品先', 'STAYCOOL樂團', '', 1, 1, 0, '2009-02-05 00:02:07', '2015-03-12 13:37:42', '0000-00-00 00:00:00'),
(14167, 9117, 1700, 3, 'Way to the Star', '', '2007-05-19 00:00:00', 0000, 0, 2, 5, '', 'Verse1\nThe night we sit and watch the stars\nDown the fading darkness before the day to start\nWas that the distance all the empty prayers will fall\nToo far…….too far……\nVerse2\nYou say it’s just the way you are\nShallow lies bring you down\nThe lovers break your heart\nAnd when you stand up high those stars ain’t seem that far\nToo far……\nChorus\nDreaming on know the dreams will go shatter\nLiving on see the life all been wasted\nNow I need a change\nFor nothing ever changed\nAnyway the day comes again\n\nCreeping on when the doubt tumbles you down\nHolding on when the crowd drowning you out\nIf that’s what it takes\nNo one ever cares\nAnyway\nYou’ll see it’s my way (I’ll do my way, I’ll keep on my way)\nVerse3\nTell your fortune name your star\nKeep the faith to forecast the weather in your heart\nThe flood will stop and I know you won’t stray too far\nToo far……too far……\nBridge\nNever want to speak my prayer\nI just want to be myself\n', 315, '', '洪開', '洪開', '', 'STAYCOOL樂團', '', 1, 1, 0, '2009-02-05 00:07:03', '2015-03-12 13:37:42', '0000-00-00 00:00:00'),
