(14169, 290, 0, 1, '醉了沒', '', '0000-00-00 00:00:00', 0000, 0, 1, 7, '', '醉了沒\n詞曲：sakinu pavavaljung\n\n工作那麼累 下班以後沒消遣\n想要來點特別\n\n喝酒不會醉 妹妹不在我身邊\n好想再來一杯\n\n喝完一杯再一杯喝完再乾杯\n喝了不會醉醉了不想睡不要再靠杯\n看到那個那個妹 那麼那麼美\n這美眉似曾相識的背影熟悉的感覺\n她是誰\n\nHo hi yang hi yang x2\n\n好的 我到底 醉了 沒有 是否 還是 醒著\n高梁 啤酒 一滴都不留 我醉了', 334, '', '', '', '', '', '', 1, 1, 0, '2009-02-05 00:25:39', '2015-03-12 13:37:43', '0000-00-00 00:00:00'),
