(14173, 9967, 0, 1, '超越極限(DEMO)', '', '0000-00-00 00:00:00', 0000, 0, 1, 7, '往我們想要的世界去衝 GO！YA！\r\n\r\n\r\n過程或許不易\r\n但我不放棄\r\n我心中有幅夢\r\n\r\n(有天\r\n我會突破那些困境 YA！\r\n向前奔去 GO)\r\n\r\n\r\n遇到跌倒無法站起來的時候\r\n我仍握緊雙手\r\n我要衝破天空！\r\n〈I DON''T GIVE UP  超越極限〉\r\n〈I DON''T GIVE UP  勇敢向前〉\r\n衝破天空\r\n緊握雙手\r\n衝破那片天空\r\n\r\n\r\n有夢才能自由\r\n不會迷惑\r\n我不會退縮\r\n\r\n有天\r\n我會突破那些困境 YA！\r\n向前奔去 GO\r\n\r\n\r\n遇到跌倒無法站起來的時候\r\n我仍握緊雙手\r\n我要衝破天空！\r\n〈I DON''T GIVE UP  超越極限〉\r\n〈I DON''T GIVE UP  勇敢向前〉', '', 239, '', 'Cigaro', '刀疤,亂', '', '搖滾開跑音樂文化', '', 0, 0, 1, '2009-02-05 01:18:10', '2013-10-07 17:14:12', '0000-00-00 00:00:00'),
(14174, 9967, 0, 2, '你們永遠都不懂(DEMO)', '', '0000-00-00 00:00:00', 0000, 0, 1, 7, '複：錯過的曾經 我不會後悔 \r\n   〈牽絆的過去 把我放開〉\r\n    未知的未來 我不會膽卻 \r\n   〈我要屬於我自己的世界  GO MY WAY〉\r\n\r\nA.清醒之後 漸漸懂\r\n  我要什麼 而你們 繼續再犯錯 \r\n  I don''t care\r\n\r\nB.〈I want be myself 別再虛假〉\r\n  我只是想做 真實真正的我\r\n  〈I want be myself 別再逃脫〉\r\n  我只是想說 你們永遠不懂\r\n\r\n複： 錯過的曾經 我不會後悔 \r\n   〈牽絆的過去 把我放開〉\r\n    未知的未來 我不會膽卻 \r\n   〈我要屬於我自己的世界 OH GO MY WAY〉\r\n\r\n複2：我想走 我要的夢\r\n    〈I want be myself  I Want Dreams come true〉\r\n     我想走 我要的自由\r\n\r\nC.讓我再次回到所相信和存在的存在\r\n  別只是一再填滿 那虛偽\r\n\r\n(但過去我的勇敢我的信念去了哪)\r\n\r\n心中\r\n有些遺憾\r\n不能和你們\r\n走到最後\r\n而最後\r\n的最後\r\n你們是否還記得\r\n一起做過的夢\r\n\r\n\r\n複： 錯過的曾經 我不會後悔 \r\n   〈牽絆的過去 把我放開〉\r\n    未知的未來 我不會膽卻 \r\n   〈我要屬於我自己的世界 OH GO MY WAY〉\r\n\r\n複2：我想走 我要的夢\r\n    〈I want be mysel  I Want Dreams come true〉\r\n     我想走 我要的自由\r\n', '', 306, '', 'Cigaro', '刀疤,亂', '', '搖滾開跑音樂文化', '', 0, 0, 1, '2009-02-05 01:23:30', '2013-10-07 17:14:12', '0000-00-00 00:00:00'),
